Calcareous ring elongate, tubular, with both radial and interradial plates fragmented into a mosaic of small pieces and prolonged posteriorly, with the posterior prolongations distally linked to prolongations of neighboring plates (
Fig. 3
). Polian vesicle usually single, as long as or slight longer than the calcareous ring, sometimes 1 or 2 short additional ones exist together, mid-ventral in position, stone canal single ending with a pinecone-shaped madreporite, mid-dorsal (
Table 1
). Gonad situated in mid-body, in two clumps, one on each side of dorsal mesentery, most tubules branched. Gonad lacking ossicles.

Ossicles of body wall comprise thickened, mostly circular, flattened, open to almost closed rosettes (
Figs 4E, F
, 
5E, F
), some with central perforation (
Fig. 4E
). Tentacle ossicles comprise usually thickened, oval, open rosettes, 20–40 µm but without rods or tables of any form (
Figs 4A
, 
5A
; 
Table 2
). Perioral and introvert skin comprise large, regular tables and small, regular, open rosettes (
Figs 4B, D
, 
5B, D
; 
Table 2
). Regular tables with oval disc perforated by four large central holes and other smaller, marginal ones, and a two-pillared, low spire terminating in usually a single cross-beam and bito quadri-partite apex with 2–6 teeth, irregular tables multilocular, with numerous small perforations, and rarely intermediate ones with a closed rosette-shaped disc (
Fig. 4D
); spire sometimes absent (
Fig. 5D
). Introvert tables often concentrated in areas adjacent to tentacle bases. Pharyngeal villi with small open rosettes (
Figs 4C
, 
5C
; 
Table 2
).
